import React, { useEffect } from "react";
import { useDispatch } from "react-redux";


export default function Home() {


  const pokemons = useSelector(state);

  useEffect(() => {
    dispatchPokes();
  }, []);

  return (
    <div className="container">
      <div>
        <h1>Pokemons</h1>
      </div>
      <Pokemons />
    </div>
  );
}
